INSERT INTO `sutra_blog` VALUES  ('2009-02-19 22:10:52',1,NULL,'2008-08-31 23:11:04','d763714b-92a7-4c29-b434-25048c22bc16','<div class=\"header\"><center><img src=\"http://www.80stees.com/images/extraSmall/OFSP008_SM1.jpg\"><br>Serving up red staplers and broken printers for nearly 10 years...</center></div>','<div class=\"footer\">Copyright &copy; 1990 <a href=\"http://www.data-mosaic.com/DM/\">Initech</a></div>',NULL,'Welcome to the corporate blog of Initech',1,'',NULL,'<html>\n<head>\n<style type=\"text/css\" media=\"screen\"><!--\nbody { margin: 0px 0px 0px 0px; background-color: #FFFFFF; }\np { padding: 0px 10px 0px 10px; font-weight: bold; font-family: Verdana; font-size: 11pt; vertical-align: middle; color: #323A4B; }\n--></style>\'\n</head>\n<body>\n<p>Developer login:<br>mbolton/rocks<br><br>User login:<br>bill/rocks</p>\n</body>\n</html>',0,0,'Sample Blog');
INSERT INTO `sutra_blog_entry` VALUES  ('2009-10-04 06:24:35','<em>[Peter, Michael, and Samir are chatting as they hang around the printer] </em>\n<strong>Peter Gibbons:</strong> Our high school guidance counselor used to ask us what you\'d do if you had a million dollars and you didn\'t have to work. And invariably what you\'d say was supposed to be your career. So, if you wanted to fix old cars then you\'re supposed to be an auto mechanic. \n<strong>Samir: </strong>So what did you say? \n<strong>Peter Gibbons:</strong> I never had an answer. I guess that\'s why I\'m working at Initech. \n<strong>Michael Bolton:</strong> No, you\'re working at Initech because that question is baloney to begin with. If everyone listened to her, there\'d be no janitors, because no one would clean anything up if they had a million dollars. \n<strong>Samir:</strong> You know what I would do if I had a million dollars? I would invest half of it in low risk mutual funds and then take the other half over to my friend Asadulah who works in securities... \n<strong>Michael Bolton:</strong> Samir, you\'re missing the point. The point of the exercise is that you\'re supposed to figure out what you would want to do if... \n<em>[printer starts beeping] </em>\n<strong>Michael Bolton:</strong> \"PC Load Letter\"? What the fruitcake does that mean?',3,'2008-02-07 22:37:45',1,'The printer is dead','2008-02-27 22:37:45',1,1,3),
 ('2008-08-31 22:19:02','<strong>Bill Lumbergh:</strong> Milt, we\'re gonna need to go ahead and move you downstairs into storage B. We have some new people coming in, and we need all the space we can get. So if you could just go ahead and pack up your stuff and move it down there, that would be terrific, OK? \n<strong>Milton Waddams: </strong>Excuse me, I believe you have my <a href=\"http://www.techcomedy.com/www.redswinglinestapler.com/\">stapler</a>... ',4,'2008-02-01 22:51:09',1,'Why I like Initech','2008-02-27 22:51:09',1,5,12),
 ('2008-08-31 22:18:54','<strong>Samir: </strong><em>[trying to decide if he should go along with the virus plot]</em> I have a question. \n<strong>Peter Gibbons:</strong> Yes? \n<strong>Samir:</strong> In... in these conjugal visits, you can have deep, meaningful discussions with women? \n<strong>Peter Gibbons:</strong> Yep, you sure can. \n<strong>Samir: </strong>OK, I\'ll do it. ',5,'2008-02-09 22:57:01',1,'Conjugal visits','2008-02-27 22:57:01',1,1,3),
 ('2008-08-31 22:18:49','<center><img src=\"http://farm4.static.flickr.com/3066/2284580407_c2a8173380.jpg\">\n\"We don\'t have a lot of time on this earth! We weren\'t meant to spend it this way. Human beings were not meant to sit in little cubicles staring at computer screens all day, filling out useless forms and listening to eight different bosses drone on about about mission statements.\" </center><table width=\"100%\"><tr><td align=\"right\">—Office Space, 1999</td></tr></table>',6,'2008-02-20 22:58:07',1,'#01 - CUBICLE','2008-02-27 22:58:07',1,5,12),
 ('2008-08-31 22:18:30','Several phrases, items and concepts from the film have found their way into common usage (particularly in office environments):\n<ul><li>TPS report — denotes any type of pointless office paperwork, based on the film\'s satirical example of such work.</li>\n<li>PC Load Letter — an actual HP laser printer error message indicating that the printer needs letter-sized paper, but more generally a catch-all for any nonsensical error message. The \"PC\" in the phrase stands for \"Paper Cassette\", a paper reservoir for many printers. This error is more common in Europe when printing US documents on printers loaded with size A4 paper.</li>\n<li>In the movie, the printer\'s unreliability finally prompts Peter, Samir and Michael to take a baseball bat to the device in an open field as \"Still\" by Geto Boys plays, in a scene visually referencing a violent episode in Casino. The term Office Space-style, or \"Going Office Space on\" is used to refer to this type of destruction.</li>\n<li>Did/Didn\'t you get that memo? — refers to a question a worker is asked by multiple supervisors at varying levels.</li>\n<li>Red Swingline stapler — The item that is the only constant in the life of abused employee Milton Waddams, who snaps after it is stolen. Swingline hadn\'t made red staplers in years, and a red Swingline was not available from office supply shops when Office Space was released (a prop department employee, named Ric Trzeciak, painted one PPG red, according to the film\'s commentary), but due to popular demand Swingline released a limited run of the red version in 2004. The official Swingline product page describes the product thus: \"Discover the stapling star of any office space - the bold head-turning design and legendary performance of Swingline\'s Rio Red Stapler.\"</li>\n<li>Pieces of Flair — refers to the mass quantities of buttons and pins Joanna is required to wear while working at the fictional Friday’s-esque restaurant \"Chotchkie\'s\", as in the title of the 2005 \"Special Edition, with Flair\" DVD release. (Tchotchke is a Yiddish word meaning \"worthless trinket\"—like the pieces of flair). Peter Gibbons criticises the practice, saying, \"You know, the Nazis had pieces of flair that they made the Jews wear.\"</li></ul><table width=\"100%\"><tr><td align=\"right\"><em>information mined from <a href=\"http://en.wikipedia.org/\">Wikipedia</a></em></td></tr></table>',7,'2008-02-27 23:02:53',1,'Office Space-isms','2008-02-27 23:02:53',1,3,3);
INSERT INTO `sutra_blog_quote` VALUES  (4,'2008-03-06 19:58:34','2008-09-01 23:25:07','Human salvation lies in the hands of the creatively maladjusted.','Martin Luther King, Jr.','2008-03-01 06:00:00',1,0,'fde88807-6c62-45b6-afaa-4cb5d41be6ed',1),
 (5,'2008-03-06 20:02:35','2008-09-01 23:25:07','All paid jobs absorb and degrade the mind.','Aristotle','2008-03-02 06:00:00',1,0,'8cdac158-4c71-49d5-93c7-c1c55386af12',1),
 (6,'2008-03-06 20:03:52','2008-09-01 23:25:07','Facts are stubborn things, but statistics are more pliable.','Mark Twain','2008-03-03 06:00:00',1,0,'14cd594e-1ea6-44e1-96ef-6024c6020650',1),
 (7,'2008-03-06 20:04:41','2008-09-01 23:25:07','I believe in equality for everyone, except reporters and photographers.','Mahatma Gandhi','2008-03-04 06:00:00',1,0,'e8f7f22f-7521-4539-9256-dffc35e3827e',1),
 (8,'2008-03-06 20:06:35','2008-09-01 23:25:07','It does not matter how slowly you go so long as you do not stop.','Confucious','2008-03-05 06:00:00',1,0,'22a662af-2ff2-4d3b-8995-60ca6ca92db9',1),
 (9,'2008-03-06 20:07:29','2008-09-01 23:25:07','Beware of the young doctor and the old barber.','Benjamin Franklin','2008-03-06 06:00:00',1,0,'f5875a1a-9640-40cb-bd53-909184f57bd4',1),
 (10,'2008-03-06 20:08:41','2008-09-01 23:25:07','The avoidance of taxes is the only intellectual pursuit that carries any reward.','John Maynard Keynes','2008-03-07 06:00:00',1,0,'5ce7a6b6-379d-499a-9b13-922599c4d521',1),
 (11,'2008-03-06 20:09:57','2008-09-01 23:25:07','The artist doesn\'t have time to listen to the critics. The ones who want to be writers read the reviews, the ones who want to write don\'t have the time to read reviews.','William Faulkner','2008-03-08 06:00:00',1,0,'59e0a941-4518-44e6-a199-9996e2715492',1),
 (12,'2008-03-06 20:11:22','2008-09-01 23:25:07','Life is like an ice-cream cone, you have to lick it one day at a time.','Charlie Brown','2008-03-09 06:00:00',1,1,'59308d07-dfb2-4441-a4e3-7b6744064362',1),
 (13,'2008-03-06 20:12:20','2008-09-01 23:25:07','Success covers a multitude of blunders.','George Bernard Shaw','2008-03-10 05:00:00',1,0,'7ea72537-7300-4ffc-92a5-144698aca9be',1),
 (14,'2008-03-06 20:12:49','2008-09-01 23:25:07','Anyone who has got a book collection and a garden wants for nothing.','Cicero','2008-03-11 05:00:00',1,0,'493b8a43-9e9b-4321-bbcc-92d180e41cf0',1),
 (15,'2008-03-06 20:12:55','2008-09-01 23:25:07','A woman drove me to drink and I didn\'t even have the decency to thank her.','W.C. Fields','2008-03-12 05:00:00',1,0,'f3b7543e-e829-4c99-b875-36ab16f804a7',1),
 (16,'2008-03-06 20:14:28','2008-09-01 23:25:07','Too bad all the people who know how to run the country are busy driving taxi cabs and cutting hair.','George Burns','2008-03-13 05:00:00',1,0,'0356eeff-fd23-43c3-9bae-f61a3380af69',1);
