INSERT INTO `sutra_documentation` VALUES  (5,'2012-09-11 22:35:55','2013-03-21 18:46:16',NULL,NULL,NULL,NULL,'<html>\n  <head>\n\n  </head>\n  <body>\n    <h1>\n      Welcome to Data Sutra 4.0.2\n    </h1>\n    <h3>\n      Servoy 6.1.4i1 | Gentoo Linux | Last server update: March 21, 2013\n    </h3>\n    <p style=\"line-height: 15px\">\n      Thank you for checking out Data Sutra. Your login was initialized with \n      data specific to your login using the SaaS capabilities of Data Sutra. \n      So feel free to play around with things.\n    </p>\n    <p style=\"line-height: 15px\">\n      Keep in mind that this is a demo server only and is not to be used for \n      any kind of production purposes or real data.\n    </p>\n    <p style=\"line-height: 15px\">\n      <span style=\"line-height: 1.22\">- Bug reports/feature requests are much \n      appreciated! Use the feedback tab on each screen for this or file in our \n      project system:&#160;</span>http://community.data-sutra.com/projects/datasutra/issues/new\n    </p>\n    <p style=\"line-height: 15px\">\n      <span style=\"line-height: 1.22\">- US host details:</span>\n    </p>\n    <p style=\"line-height: 15px\">\n      - blades with Intel Xeon 5650 processors running at 2.67GHz<br>- 2.5&quot; \n      SAS harddrives in a raid 10 config<br>- 96 GB RAM per blade<br>- \n      gigabyte ethernet ports and an integrated LSI 1064e SAS controller<br>- \n      located in St Paul, Minnesota at a highly secure and redundant hosting \n      facility\n    </p>\n  </body>\n</html>\n',NULL,NULL,1);
