INSERT INTO `sutra_solution` VALUES  (1,'Data Sutra','Build Beautiful Business Applications',1260,694,NULL,NULL,NULL,1,1,2,22,1,200,'servoy',0,'#',100,'Friends of Data Sutra','JED46D5-AJ96271-JH2409B','M-d-yyyy',0,1,NULL,1,NULL,'data_sutra.png','The awesome sauce is waiting!','http://www.data-sutra.com/',NULL,NULL,NULL,0,200,225,200,225,200,170,200,200,200,'en',NULL,0,0,'',NULL,'',200,200,'<html>\n<head>\n\n<style type=\"text/css\" media=\"screen\">\n<!--\nbody { margin: 0px 0px 0px 0px; background-color: #FFFFFF; }\n.big { font-size: 250%; padding: 0px 10px 0px 10px; font-weight: 500; color: #464658;}\n.bigorange { font-size: 200%; color: rgb(216, 98, 77); padding: 0px 10px 0px 10px; }\n.orange { font-size: 125%; color: rgb(216, 98, 77); padding: 0px 10px 0px 10px; }\n.mediumbig { font-size: 175%; padding: 0px 10px 0px 10px; }\n.medium { font-size: 125%; padding: 0px 10px 0px 10px; }\n.footer { padding: 0px 10px 5px 10px; color: white; text-decoration: none; font-size: 110%; background-color: rgb(216, 98, 77); }\np { font-size: 115%; text-indent: 0cm; padding: 0px 10px 0px 10px; }\np.nonp { font-size: 115%; padding: 0px 10px 0px 10px; margin: 0px 0px 0px 0px;}\n.li { padding: 5px 0px 0px 10px; }\n-->\n</style>\n</head>\n\n<body>\n<p>\n<span class=\'big\'>Data Sutra</span>\n<br>\n<span class=\'mediumbig\'>A complete platform for creating business applications with Servoy</span>\n</p>\n\n<p><span class=\'orange\'>Build great applications with Data Sutra...</span></p>\n<div class=\"li\">\n<p class=\"nonp\">•&nbsp;&nbsp;Rapidly build desktop quality solutions with its comprehensive collection of frameworks, helper functions, resources, coding guidelines, data driven configurators, templates, and much more</p>\n<p class=\"nonp\">•&nbsp;&nbsp;Manage and communicate with your users via a high level access and control manager, integrated help system, inline user feedback, activity tracking, notifications, and user level preferences</p>\n<p class=\"nonp\">•&nbsp;&nbsp;Deploy a speedy rich GUI application across the wire as a result of detailed speed optimizations and our unique client-side meta data caching mechanism</p>\n<p class=\"nonp\">•&nbsp;&nbsp;Prototyping, screen building, workflow coding, testing, deployment, user management, long term upgrading -- save yourself a few years of coding and get it done now with Data Sutra</p>\n</div>\n\n<!--\n<p></p>\n<div class=\"footer\">Data Mosaic, Sutra CMS&nbsp;Copyright &copy; 2011</div>\n-->\n\n</body>\n</html>\n',0,'Welcome to Data Sutra!','<html>\n<head>\n<style type=\"text/css\" media=\"screen\"><!--\nbody { margin: 0px 0px 0px 0px; background-color: #FFFFFF; }\np { padding: 0px 10px 0px 10px; font-weight: bold; font-family: Verdana; font-size: 11pt; vertical-align: middle; color: #323A4B; }\n--></style>\'\n</head>\n<body>\n<p>Developer login:<br>mbolton/rocks<br><br>User login:<br>bill/rocks</p>\n</body>\n</html>','',NULL,NULL,,'71995.00','png','Community',NULL,1,0,1,NULL,'',0,179,1,0,NULL);
