 (537,'a19d2554-1ae1-4f85-9434-3a5d165ee4d0','2008-10-31 16:57:18','2008-11-04 17:22:19','en','Button: Add','The \"Add\" button has become a standard UI element in many user interfaces today. Users expect this to create a new record on the currently selected form.  Because this is such a common action, we have supplied a default method for this action.  You can optionally select a method of your own that will be triggered when the \"Add\" button is clicked. An example would be a method that opens a form in dialog for user entry of a new record (used sometimes when accuracy of data entry is important).',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__add','help_button_add'),
 (538,'6efaeb67-56d0-47c5-ab75-f049bd08a51b','2008-10-31 16:57:18','2008-11-04 17:22:19','en','companies',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F_column__fastfind','fld_G_find_relation'),
 (539,'7fc0fb40-972e-4922-bb7b-cda061964aa5','2008-10-31 16:57:18','2008-11-04 17:22:19','en','Fast find fields','Click on a field to add it to the fast find list. The field list generated is based on the table of the form assigned to the navigation item or the relationship chosen above.',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F_column__fastfind','help_ff_columns'),
 (540,'5f350180-8c6e-4dd2-a4fc-7efde21f6545','2008-10-31 16:57:18','2008-11-04 17:22:19','en','Fast find items','Records here are the fields available to the user to search on. Choose fields to add from the field list on the right. Rename the field to something more user friendly for the user to read.\n\nYou can optionally add a value list to restrict the values that the user can search with. When a search is triggered on a value list find field, the value list is presented to the user to select from.\n\nYou can optionally set a default search. This will be the field that will be searched on if a user enters search criteria without selecting a field. Options include none, a specific field, all text fields, all date fields and all numeric fields.  ',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F_column__fastfind','help_ff_list'),
 (541,'7f8d3319-4649-4661-a703-d11d6180ee57','2008-10-31 16:57:18','2008-11-04 17:22:19','en','Fast find tables','You have a drop down of relationships available from this table to other tables. Choosing one will pull in the available fields through the relationship selected.',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F_column__fastfind','help_ff_table'),
