 (564,'820f9637-2580-417e-bebe-c870d08e1b6b','2008-10-31 16:57:19','2008-11-04 17:22:19','en','Dynamic filter specification','See the inline help for filter specification.   Note that dynamic filters cannot have multiple filter specifications.',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__filter_3L_action_item_filter__derived','help_button_filter_dynamic'),
 (565,'e4531023-158b-47a2-b8c5-c31b8e7d1179','2008-10-31 16:57:19','2008-11-04 17:22:19','en','Dynamic filter post processing','<html><head></head><body>There are three options to post process the returned foundset of a filter:  <br><br>1- Sort <br>2- Max records <br>3- Run a method  <br><br>Example: using the sort and max records, you can return the top 5 sales records starting with the highest value. Then trigger a method to show a pie chart in a dialog.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__filter_3L_action_item_filter__derived','help_button_filter_dynamic_post'),
