 (614,'c8fa5cd3-f16b-4e85-952b-d98703c9751a','2008-10-31 16:57:23','2008-11-04 17:22:19','en','Filter post processing','<html><head></head><body>There are three options to post process the returned foundset of a filter:\n<br><br>\n1- Sort<br>\n2- Max records<br>\n3- Run a method\n<br><br>\nExample: using the sort and max records, you can return the top 5 sales records starting with the highest value. Then trigger a method to show a pie chart in a dialog.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__filter_3L_action_item_filter__custom','help_button_filter_post'),
 (615,'d27ca9af-2d86-4c12-b449-d108012df524','2008-10-31 16:57:23','2008-11-04 17:22:19','en','Help details','<html><head></head><body>Frameworks help mode is accessed from the Frameworks action menu (top right button on the screen). (Note: you can turn this off for a group if Access & Control is turned on.)\n<br><br>\nUse this form to setup the help information that a user sees when they enter help mode. The description field here will be shown in the list area if no specific form is assigned under the forms section. You can optionally format the font and field background color to create a distinctive look for help mode.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__help','help_help'),
 (616,'b74cddb8-acf1-4802-bd98-1100cd6d37d2','2008-10-31 16:57:23','2008-11-04 17:22:19','en','Help form','<html><head></head><body>Frameworks help mode is accessed from the Frameworks action menu (top right button on the screen). (Note: you can turn this off for a group if Access & Control is turned on.)\n<br><br>\nYou can optionally assign forms here to display while in help mode. This will flip out the current working form with the specified help form.\n<br><br>\nAn example usage of this is to create a module just for your help forms so you have them all in one place and then assign them to your navigation items here. \n<br><br>\nYour help system can be as comprehensive as you like!</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__help','help_help_forms'),
 (617,'96fad2cb-03b3-4bb4-b81b-5e4f388061ef','2008-10-31 16:57:23','2008-11-04 17:22:19','en','Actions',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation','actions'),
 (618,'dc88c0b8-dead-4c57-9bbb-8c20e2d7b3dc','2008-10-31 16:57:23','2008-11-04 17:22:19','en','Actions',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation','actions_up'),
 (619,'dcf89589-eb46-42f3-afa2-93d2ad0744a5','2008-10-31 16:57:24','2008-11-04 17:22:19','en','New record',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation','btn_add'),
 (620,'c96ab2fb-643e-4e12-8a3b-69d40059d14c','2008-10-31 16:57:24','2008-11-04 17:22:19','en','Move selected set down',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation','btn_down'),
 (621,'f4ec1263-a838-438c-9679-381c8a420594','2008-10-31 16:57:24','2008-11-04 17:22:19','en','Move selected set up',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation','btn_up'),
 (622,'74513a2a-6405-4357-8fae-9a3d9e9b7821','2008-10-31 16:57:24','2008-11-04 17:22:19','en','Navigation sets','<html><head></head><body>Manage navigation sets here. Create, duplicate, and delete are the main options. Duplicating a navigation set will duplicate all settings.\n<br><br>\nThe first check box is the master \"switch\" that turns on or off access to a particular navigation set. Even if a non-active navigation set is assigned to a login group in Access & Control, it will not be accessible. \n<br><br>\nThe second check box is the navigation set that a user arrives on when opening the solution. This is only valid when Access & Control is turned off.\n<br><br>\nYou can also specify the order of the navigation sets. </body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0L_navigation','help_nav_set'),
 (623,'6ec19a2d-f86d-4a6c-b9fc-0a712ce485af','2008-10-31 16:57:24','2008-11-04 17:22:19','en','Filter specification: value list','<html><head></head><body>Filter specification is comprised of the following components (very similar to the Servoy relation specification form). <br><br>In this case, the specification you define will be applied to each value list item.  <br>1- Table column to filter on. All columns from the current top level table and table columns from relationships are options.  <br>2- Matching operator. =, >, >=, <, <=, !=, and \"like\" are available.  <br>3- Value to filter by. This is the search criteria that will be applied to the table column to filter by. <br><br>When you static value list this value is filled with the value list value.   <br><br>POWER USER TIP: match with a function  Notice that there are two filter types: \"Value\" and \"Function\". \"Value\" works as described above.  The \"Function\" type allows you to apply a method to return the parameter to filter by instead of a static value. For example this allows you to return the current date.  You can also pass an argument to the function. <br><br>Example: create a function that returns a date search string starting x amount of days from today and ending with today. This search string will be matched up with a date field. Use the argument field to specify how many days before today you want the range to be.  This means you can use the same function on filters labeled \"Last 30 days\", \"Past week\", and \"Today\" by adjusting the argument passed to the function. </body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_P_action_item__valuelist','help_button_filter_valuelist'),
 (624,'2f6b0f56-2080-43fd-998e-9e269b641e99','2008-10-31 16:57:24','2008-11-04 17:22:19','en','Add tab',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__tab_3L','btn_add'),
