 (628,'0779d015-ec0e-4ad9-ad42-e06ace32ad05','2008-10-31 16:57:24','2008-11-04 17:22:19','en','Actions',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','btn_actions_list'),
 (629,'b3df80d2-a1d6-439a-a0e8-371b63ff1287','2008-10-31 16:57:25','2008-11-04 17:22:19','en','Clear field',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','btn_clear_space_default'),
 (630,'e673676d-8a4c-4285-9803-597dc87b2535','2008-10-31 16:57:25','2008-11-04 17:22:19','en','Clear field',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','btn_clear_space_method'),
 (631,'bcd58196-e446-4478-a873-224eace260aa','2008-10-31 16:57:25','2008-11-04 17:22:19','en','Clear field',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','btn_custom_list'),
