 (633,'7c31fd69-a4ee-4725-97d2-ebe11846e42a','2008-10-31 16:57:25','2008-11-04 17:22:19','en','Show sort picker',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','btn_sort_string'),
 (634,'c2a95cc9-a990-4dcd-85a0-aae1ac69a1da','2008-10-31 16:57:25','2008-11-04 17:22:19','en','If something is entered here, it will over-ride the inital sort on the workflow form',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','fld_sort_string'),
 (635,'d07a6a8f-7ef7-491e-897d-0b6de4766c75','2008-10-31 16:57:25','2009-02-27 16:03:21','en','Details','<html><head></head><body>1- Name: display name for this navigation item\n<br><br>\n2- Registry: see notes below\n<br><br>\n3- Description: this data area could be useful for reporting on your navigation sets and items. \n<br><br>\nREGISTRY EXPLANATION\n<br><br>\nIn certain scenarios you may want to programmatically change the\nnavigation item that a user is on without requiring the user to click on a navigation item.\n<br><br>\nThis is done by using the following Frameworks callback function with the registry value for the form you want to jump to. Note that the registry value is text and needs to be unique (non-unique values are not allowed on data entry).\n<br><br>\nCALLBACK_goto_navigation(registry, [setFoundset], [specifyFoundset]) \n<br><br>\n1- registry of navigation_item to jump to (required).<br>\n2- true/false to apply current related foundset to the destination form (optional).<br>\n3- foundset to restore on destination form. Send the actual foundset object...no quotes (optional).<br>\n<br><br>\nEXAMPLE USAGE\n<br><br>\n1- Most common usage is to pass the registry value in the first parameter and true for the second parameter. This will transfer the foundset of a form being shown through a relation to a form not shown through a relationship. And you will arrive on the correct record index.\n<br><br>\n2- If your destination form is based on a separate table, the third parameter allows you to pass a foundset object. This is useful if you want to see a set of related records for the current form.\n<br><br>\nEXAMPLE REGISTRY VALUES\n<br><br>\nSince registry values are strings and need to be unique, a naming convention is helpful. Quote from a beta tester:\n<br><br>\n\"So what I just did to try to simplify is to give each navigation set\nit\'s own number in the hundreds, then number consecutively within the\nnav set:\n<br><br>\nAccount Management<br>\n101<br>\n102<br>\n103\n<br><br>\nAdministration<br>\n201<br>\n202<br>\n203<br>\n204\"</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','help_details'),
 (636,'fb183575-5420-42a6-87ac-853c24653dab','2008-10-31 16:57:25','2008-11-04 17:22:19','en','Forms','<html><head></head><body>This is the heart and soul of the Frameworks engine. There are two \"spaces\" that you can specify a form to be shown when you click on a navigation item -- the workflow space and the list space. (Use the module selector to see forms from a specific module.)\n<br><br>\nThis allows you to create modules for your specific workflow screens to keep them organized and then connect them to Framworks here.\n<br><br>\nA powerful feature of Frameworks is the Universal List. Selecting \"Use UL\" allows you to easily configure various lists for the list area in our UL list configuration pane. This removes the chore of tediously creating many list forms.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','help_forms'),
 (637,'087b6f22-71b4-4399-a976-b403d9ba1b34','2008-10-31 16:57:25','2008-11-04 17:22:19','en','Notifications','<html><head></head><body>1- Servoy loads forms into memory on demand. This can result in a noticeable form load delay the first time you visit that form or if Servoy has dumped the form from memory (this is based on client memory settings). Use this section to turn on the notification toolbar while the form loads (with a label of your choosing) to give the user feedback during this process.<br><br>\n\n2- Additionally, Servoy loads record data into memory on demand. Depending on the network and amount of related data displayed, this can result in a noticeable load delay. Use this section to turn on the notification toolbar while the data is being loaded.<br><br>\n\n(NOTE: as of Servoy 3.5.x, it is impossible to detect whether a record has been dumped from memory -- which Servoy does as part of its garbage collection. So unlike the form notification, record notification will only work the first time a record loads. <span color=\"red\">TODO: revisit possibilities with Servoy 4.x.</span>)<br><br>\n\n3- Selecting \"UL Busy\" will change the cursor to a busy ball until all form and record data is loaded.<br><br>\n\nRECOMMENDED USAGE<br><br>\n\nSelect all three notifications. Defaulting to more user feedback is not a bad idea.\n\n</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','help_notify'),
 (638,'0a3caa7f-01ca-4cc8-98ec-77e4fca20c01','2008-10-31 16:57:25','2008-11-04 17:22:19','en','Sort','<html><head></head><body>This shows what the initial sort value is for the workflow form if there is a initialSort property specified.<br><br>\n\nYou can change it here to override this value.<br><br>\n\n<div color=\"red\">TODO: fire on fast finds and filters (do not fire on goto_navigation when a foundset is supplied)</div></body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','help_sort'),
 (639,'ee01b29d-9273-4411-931b-57865d0a36de','2008-10-31 16:57:25','2008-11-04 17:22:19','en','Spaces','<html><head></head><body>The main area of the Frameworks window is divided into three \"spaces\": navigation, list and workflow.\n<br><br>\nThere is a spaces button bar at the top left of the screen that allows the user to toggle between various arrangements of the spaces. \n<br><br>\nUse this section to enable which arrangements are available to the user.\n<br><br>\n\"Flip\" is the inverted state of an space arrangement. When you click a space button a second time, the flip state is activated. The flip state exchanges the navigation space with the list space.\n<br><br>\nIf an arrangement has the flip version enabled, check the \"Flip first\" to make the flipped state the default behavior for the first click on a space arrangement button.\n<br><br>\nOptionally set a default space arrangment from the spaces you have enabled. If none is specified, the Standard arrangement will be the default state.\n<br><br>\nLastly, you can specify a global method to run when a spaces arrangement button is clicked. This is especially useful if you want to show a different list form or Universal List setup to accommodate a wider or narrower list view. Use \"CALLBACK_ul_set_display(displayPosition)\" to specify a different Universal List.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','help_spaces'),
 (640,'6c93ff68-8ee7-46cf-983f-7b6feaa9f36e','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Button: Actions','<html><head></head><body>The \"Actions\" button is button where you can add as many action items as you want. Each item can be attached to a method to run when selected.\n<br><br>\nAlternately, you can elect to enter code directly in the box provided to trigger when an item is selected. Cool color coding provided because we can.\n<br><br>\nIn the list, you can use the \"-\" character to divide sections of the list.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__action','help_button_actions'),
 (641,'dea2d7de-3552-4a6c-a671-bc969b892217','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Remove from findable columns',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F_column__fastfind_2L__left','btn_remove'),
 (642,'852aa77c-d69e-4253-98ef-97caf6dd867c','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Toggle detail',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__universal_lists_2F_list_display','btn_detail_left'),
 (643,'9fd1b3c6-c372-4dd8-bcf8-4516ca1042fe','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Toggle detail',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__universal_lists_2F_list_display','btn_detail_right'),
 (644,'7dec04ad-9751-4dc9-aed1-0277b0222749','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Universal list columns','<html><head></head><body>\nCreate universal list display column from the field list on the right. Each column has a number of properties associated with it. The most important property is the width.<br><br>\n\n<div color=\"red\">IMPORTANT: the width property column for all the rows should add up to 100%</div>\n\nThe type and and mask columns are optional. Use these to apply formatting to your data. Each type has a number of example masks supplied but you can use Servoy\'s mask notation to create any mask you want.<br><br>\n\nThe bool(ean) and value list types are special cases. Use these when the data stored needs to be displayed based on a mapping stored in a value list. The boolean value list can be typed in directly here. Non-boolean value lists need to be specified from the drop down list (which means the value list you want to use needs to be created in your solution somewhere).\n\n</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__universal_lists_2F_list_display','help_ul_details'),
 (645,'fc043162-9f84-4f3c-925f-bfda24ed12f9','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Universal list fields','<html><head></head><body>Click on a field to add it as a universal list column. The field list generated is based on the table of the form assigned to the navigation item.\n<br><br>\nAdditionally, you have a drop down of relationships available from this table to other tables. Choosing one will pull in the available fields through the relationship selected.\n<br><br>\nClick the \"(popup)\" text to open this list by itself so you can more of the data.\n<br><br>\nConversely, clicking the arrow will hide/show this list.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__universal_lists_2F_list_display','help_ul_fields'),
 (646,'073f6c26-4d9b-4903-9df0-c7a8769e1dd6','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Blank','Let me tell you a story....',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__filter_3F_children','help_button_filter_blank'),
 (647,'5a25b4a7-e685-4cbe-9f50-5d9e02be2808','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Actions',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation_item','actions'),
 (648,'53196f22-ec08-43f1-8346-55bcf00269ca','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Actions',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation_item','actions_up'),
 (649,'76e465a7-b9b6-40f5-94a9-b860bff8274e','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Move selected item down',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation_item','btn_down'),
 (650,'c77cf091-14e9-4990-a8af-7e91853d5298','2008-10-31 16:57:26','2008-11-04 17:22:19','en','New record (shift-click for new child)',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation_item','btn_new'),
 (651,'92d97f38-a0f4-44b4-8f5f-5eaf845f2ec8','2008-10-31 16:57:26','2008-11-04 17:22:19','en','Move selected item up',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0L_navigation_item','btn_up'),
 (652,'c95f186b-12c9-465c-9d4d-e975c3f97bf8','2008-10-31 16:57:27','2008-11-04 17:22:19','en','Navigation sets','<html><head></head><body>Manage navigation items here. You can have two levels of items with the top level being collapsable.<br><br>\n\nUse the various actions and controls to create, delete, reorder, and specify level of items.<br><br>\n\n<div color=\"red\">TODO: duplicate item</div></body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0L_navigation_item','help_nav_set_item'),
 (653,'cc2d5440-4477-443d-a16a-1abd52542b66','2008-10-31 17:57:33','2008-11-04 17:22:19','en','Record filter rules by table','<html><head></head><body><strong>Record filter rules by table</strong><br><br>\n\n• Record rules are applied at login<br>\n• Rules need a table column, a match operator, and a global variable<br>\n• Global variables should be filled with a method run pre-login (see Access & Control groups)<br>\n• Use the database tab to apply the same rule to all tables in a database connection<br><br>\n\nSee addition record rules information and explanations under the database tab contextual help</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_solution__prefs_1F_filter_2L__table',NULL),
 (654,'5fd59234-9ff1-4e50-a1ac-0392bd8fc33e','2008-10-31 17:58:11','2008-11-04 17:22:19','en','Record filter rules for all tables in a database','<html><head></head><body><strong>Record filter rules by database</strong><br><br>  • Record rules are applied at login<br> • Rules set up at the database connection level apply to all tables in the database<br> • Rules need a table column, a match operator, and a global variable<br> • Global variables should be filled with a method run pre-login (see Access & Control groups)<br><br><br>   DEFAULT USAGE<br><br>  1- Filter on organization id<br><br>  • Create an organization_id column in all of your data tables<br> • Assign \"globals.AC_current_organization\" to the auto-enter property of each organization_id column<br> • Create a database filter and assign \"globals.AC_current_organization\" global variable to organization_id column. Use the \"=\" operator<br><br>  2- Filter on user id<br><br>  • Create a user_id column in all of your data tables<br> • Assign \"globals.AC_login_id\" to the auto-enter property of each user_id column<br> • Create a database filter and assign \"globals.AC_login_id\" global variable to user_id column. Use the \"=\" operator.<br><br><br>   ADVANCED FILTER NOTES<br><br>  1- You can run your own custom method to assign values to a global variable of your choosing on the groups configuration pane. This is \"Login method A\" in group details. This allows you to create and populate your own matching rule globals beyond the defaults (organization and user) we give you.<br><br>  2- The matching operators allowed are: =, <, >, >=, <=, !=, and LIKE. Servoy\'s \"addTableFilterParam()\" function also allows the \"IN\" operator but this is not an option in our interface. To get the behavior of the \"IN\" operator, create multiple rules for a table. Alternately, you can apply your own \"addTableFilterParam()\" function with a method triggered at group \"Login method A\" (very advanced users only!).<br><br>  3- You can create rules at the solution scope (this interface) and also at the group scope (groups pane). Rules from both scopes are combined at login allowing for very granular filtering to be applied. <br><br>  4- A limitation to Servoy\'s \"addTableFilterParam\" in version 3.5x is that you can only filter on one column per table. So if you set up multiple filters on a table with rules pointing to multiple columns, the first rule created at the group scope wins. After that, the order of precedence is not easily determined because we put all rules into an unsorted named object before applying them.<br><br>  <strong>Moral of the story: only use one match column per table!</strong></body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_solution__prefs_1F_filter_2L__database',NULL),
 (657,'09140f70-d6e8-4e51-a357-d76aa6b48bc6','2008-11-03 12:56:03','2008-11-04 17:22:19','en','Navigation','Specify navigation sets and landing point for this group.',NULL,1,1,'_ds_AC_access_control','AC_0F_group__navigation',NULL);
INSERT INTO `sutra_tooltip` VALUES  (661,'6ed82c5d-ade1-4c05-90be-e04c450b642f','2008-11-03 13:05:14','2008-11-04 17:22:19','en','Users','<html><head></head><body>Manage users assigned to this group.\n<br><br>\nNote that users can be assigned to more than one group.\n<br><br>\nAdvanced: if you are not using our organizations and staff interface to organize your users, change the value lists and header text on the organizations and staff columns on this form to match that of your structure. \n<br><br>\nIf you have an organization structure that has more than 2 tiers, add additional columns to match the various tiers if you like.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_group_1L_user_group',NULL),
 (662,'f7919490-2068-4a2d-a1e9-ee9df975c556','2008-11-03 13:14:42','2008-11-04 17:22:19','en','Record filters','<html><head></head><body>You can specify record filtering rules at the group level. These will be combined with whatever solution level rules you have defined.\n<br><br>\nThis allows for granular control of record filtering. However, in most cases solution level record filters is all that is needed.\n<br><br>\nFor a full explanation on record filtering, see inline help for \"Access and Control: Preferences\".</body></html>',NULL,NULL,NULL,'_ds_AC_access_control','AC_0F_group__record',NULL),
 (663,'3043edf5-2379-46a0-a6bf-50b06860737f','2008-11-03 13:26:55','2008-11-04 17:22:19','en','Toolbars','<html><head></head><body>Toolbars show up in the top middle part of the frameworks window. You switch between them by clicking on the arrow on the left part of the toolbars window.\n<br><br>\nToolbars are forms with specific functionality that apply solution-wide. Frameworks ships with a number of toolbars you can use in your solution: Title bar, Record navigator, Browsing history, Weather, and the Console.\n<br><br>\nYou can also create your own toolbars by adding forms and functionality to the module \"rsrc_TOOL_toolbars\" and then setting up a record in the Toolbar registry configuration pane for each toolbar. Some ideas: stock ticker, IM client, world clocks, etc.\n<br><br>\nNote that toolbars can optionally drop down a \"sheet\" to display more information. Examples of this are the Weather and Console toolbars.</body></html>',NULL,NULL,NULL,'_ds_AC_access_control','AC_0F_group_1L_group_toolbar',NULL),
 (664,'95c2a442-c8ae-40ba-9604-3fbf4a710d2f','2008-11-03 13:34:27','2008-11-04 17:22:19','en','Blogs','<html><head></head><body>Assign a blog to this group. Create blogs in the \"Blog setup\" configuration pane.\n<br><br>\nCurrently, only one blog can be assigned to a group.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_group_1L_group_blog',NULL),
 (665,'a65e8339-8feb-4df1-a14d-e58685199550','2008-11-03 14:15:56','2008-11-04 17:22:19','en','Actions','<html><head></head><body>Assign any workflow specific actions that this group is allowed to do. If an action is not assigned, the value returned for that action will be false for anyone logged in under this group.\n<br><br>\nYou \"register\" actions for your application under Access and control: preferences. See the inline help there for more information.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_group_1L_group_action',NULL),
 (666,'7a3d3e7a-2482-411b-8536-f8058cd36091','2008-11-03 15:02:51','2008-11-04 17:22:19','en','Groups','<html><head></head><body>You can assign groups to this user here or optionally assign users to groups on the group screen.\n<br><br>\nA user can belong to more than one group. If this is the case, at login the user will be prompted to choose which group to login under. (Currently, there is no support for \"merging\" the privileges of multiple groups.)</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_user_1L_user_group',NULL),
 (667,'4af1f753-3a00-44af-abee-3944d11ba121','2008-11-03 15:06:14','2008-11-04 17:22:19','en','Access log','<html><head></head><body>A handy viewer for all the login and logout records for this user and the associated session data.\n<br><br>\nFor your own reporting, this data is stored in the \"mosaic_frameworks\" connection in table \"mosaic_access_log\". This table is related to servoy_client_stats table in the repository on columns \"mosaic_access_log.servoy_uuid = servoy_client_stats.client_id\".\n<br><br>\nNote: we don\'t actually have a relation defined back to the repository -- but the data from the repository table is in the \"mosaic_access_log\" table in case you want to relate back yourself.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_user_1L_log',NULL),
 (668,'d74f7956-6db1-4cc5-b649-fa79ca3674e7','2008-11-03 15:17:20','2008-11-04 17:22:19','en','Solution preferences','<html><head></head><body>Set up solution windowing values for the user. These settings will override the same values set up at the solution scope (Solution configuration pane).\n<br><br>\nGood for when a particular user has a non-standard screen size.</body></html>',NULL,NULL,NULL,'_ds_AC_access_control','AC_0F_user_1F__solution',NULL),
 (677,NULL,'2009-02-13 13:54:11','2011-02-01 07:44:00','en','Tooltips may be configured to do many things...','Such as:\n- providing inline help\n- jumping to another form\n- annoying end users\n- cutting way back on the amount of support you need to field',NULL,1,NULL,'_ds_MGR_resource_manager','MGR_0F_tooltip','help_tooltip'),
 (691,NULL,'2009-02-27 16:39:40','2010-12-03 16:58:26','en','<html>\n  <head>\n    \n  </head>\n  <body>\n    Perform search<br>&#160;- <strong>shift</strong> key restricts search<br>&#160;- \n    <strong>control</strong> key extends search<br>&#160;- <strong>alt/option</strong> \n    key omits search<br>&#160;- # at beginning is a starts-with search (<strong>#</strong>Data)<br>&#160;- \n    # at end is an ends-with search (osaic<strong>#</strong>)<br>&#160;- # at \n    beginning and end is an exact match search (<strong>#</strong>Servoy<strong>#</strong>)\n  </body>\n</html>',NULL,NULL,NULL,NULL,'__DATASUTRA__','DATASUTRA_0F_solution__header__fastfind','btn_find'),
